import React from "react";

const Pistols = (props) => {
  return (
    <div className="pistol-Card">
      <h1>{props.fullData.documents[0]}</h1>
      {console.log("props.documents: ", props.fullData.documents)}
    </div>
  );
};

export default Pistols;
